css:
@-moz-document domain("vuejs.org") {
body,
body > div,
.book-summary,
.book-body,
#book-search-input {
	color: #4A7099 !important;
	background-color: #2D2D2D !important;
}
p.tip {
	background-color: #3C3C3C !important;
	color: #A1A9B7 !important;
}
h1,
h2,
h3,
h4,
h5,
h6 {
	color: #FF8100 !important;
}
a {
	color: #8DBB6E !important;
}
li.active>a,
li.active,
a.current {
	color: #DC616A !important;
}
strong {
	color: #A1A9B7 !important;
}
p code {
	background-color: #3C3C3C !important;
	text-shadow: none !important;
}
code[class*="language-"],
pre[class*="language-"] {
	text-shadow: none !important;
}
figure {
	background-color: #3C3C3C !important;
}
pre {
	background-color: #3C3C3C !important;
	color: #A1A9B7 !important;
}
pre .line span.tag {
	color: #DC616A !important;
}
.page-wrapper p {
	color: #548CCD !important;
}
.page-wrapper ol > li {
	color: white;
}
.page-wrapper ol > li code {
	background-color: #3C3C3C !important;
	color: #FF8100 !important;
}
.markdown-section ul > li {
	color: #DFDFDF;
}
.token.operator {
	background: none;
}
}
